import { Col, Row } from 'react-grid-system';


function ServiceComp() {
    return (
      <div className="App">
          <div style={{ color : 'whitesmoke' }}>
              <h1>Why do you need me ?</h1>
              <Row>
                  <Col sm={6}>
                      <p style={{fontSize : '120%'}}>As we saw trough the covid-19 Pandemic, Owning an Offline business can be critical during quarantines.
                          Most of the companies struggled providing their services and products trough that specific period and a big part of them 
                          have learnt from their mistakes. Being able to provid services at any moment and from anywhere is a big
                          boost for your business and for that you need a way for you customers to reach you at any time.
                      </p>
                  </Col>
                  <Col md={6}>
                  </Col>
              </Row>
          </div>
      </div>
    );
  }

  export default ServiceComp;
